import React, { Component } from "react";
import bars from "../bars.svg";
import "./nav.css";

export default function RotatingNav() {
  return (
    <nav>
      <ul>
        <li>
          <img src={bars} />
          Home
        </li>
        <li>
          <img src={bars} />
          About
        </li>
        <li>
          <img src={bars} />
          Contact
        </li>
      </ul>
    </nav>
  );
}
